import React, { useState } from 'react';
import '../styles/home.css';
import { askGemini } from '../services/aiService';
import ChatBox from '../components/ChatBox.tsx';





interface Message {
  role: 'user' | 'model';
  parts: { text: string }[];
}

const Home: React.FC = () => {
  const [messages, setMessages] = useState<Message[]>([]);
  const [input, setInput] = useState<string>('');
  const [loading, setLoading] = useState<boolean>(false);

  const handleSend = async () => {
    if (!input.trim() || loading) return;

    const userMessage: Message = {
      role: 'user',
      parts: [{ text: input }],
    };

    const systemPrompt: Message = {
      role: 'user',
      parts: [{
        text: 'B·∫°n l√† m·ªôt tr·ª£ l√Ω ·∫£o chuy√™n v·ªÅ du l·ªãch t√™n l√† chipchip. Ch·ªâ tr·∫£ l·ªùi c√°c c√¢u h·ªèi li√™n quan ƒë·∫øn th√¥ng tin kh√°ch h√†ng v√† du l·ªãch nh∆∞ g·ª£i √Ω h√†nh tr√¨nh, ƒë·ªãa ƒëi·ªÉm tham quan, ng√¢n s√°ch, ph∆∞∆°ng ti·ªán di chuy·ªÉn, tr·∫£i nghi·ªám. N·∫øu c√¢u h·ªèi kh√¥ng li√™n quan, h√£y t·ª´ ch·ªëi m·ªôt c√°ch l·ªãch s·ª±. Kh√¥ng h·ªèi nhi·ªÅu h∆°n 1 c√¢u. Th√™m icon cu·ªëi c√¢u',
      }],
    };

    const conversation: Message[] = [systemPrompt, ...messages, userMessage];

    setMessages((prev) => [...prev, userMessage]);
    setInput('');
    setLoading(true);

    try {
      const reply = await askGemini(conversation);
      const botMessage: Message = {
        role: 'model',
        parts: [{ text: reply }],
      };
      setMessages((prev) => [...prev, botMessage]);
    } catch (err) {
      console.error(err);
      setMessages((prev) => [
        ...prev,
        {
          role: 'model',
          parts: [{ text: '‚ùå L·ªói k·∫øt n·ªëi ƒë·∫øn AI' }],
        },
      ]);
    } finally {
      setLoading(false);
    }
  };

  const renderText = (msg: Message): string =>
    msg.parts?.[0]?.text || '';

  return (
    <div className="home">
      {/* N·ªÅn logo m·ªù */}
      <img src="/cheaptrip-logo.png" alt="CheapTrip Logo" className="background-logo" />

      <div className="content">
        <h1 className="text-4xl mb-4 font-bold">Ch√†o m·ª´ng ƒë·∫øn v·ªõi CheapTrip üåç</h1>
        <p className="mb-6 text-lg">T∆∞ v·∫•n h√†nh tr√¨nh du l·ªãch th√¥ng minh v·ªõi tr·ª£ l√Ω ·∫£o ChipChip üß≥</p>

        <div className="chat-box bg-white text-black rounded-xl p-4 max-w-xl w-full mx-auto shadow-md">
          <div className="h-64 overflow-y-auto mb-4 border border-gray-300 rounded p-2 bg-gray-50">
            {messages.map((m, i) => (
              <div key={i} className={`mb-2 flex ${m.role === 'user' ? 'justify-end' : 'justify-start'}`}>
                <span
                  className={`inline-block p-2 rounded-xl max-w-xs shadow text-sm ${
                    m.role === 'user' ? 'bg-blue-500 text-white' : 'bg-gray-200 text-black'
                  }`}
                >
                  {renderText(m)}
                </span>
              </div>
            ))}
            {loading && (
              <div className="text-left mb-2">
                <span className="inline-block bg-white shadow p-2 rounded">
                  ChipChip ƒëang suy nghƒ©...
                </span>
              </div>
            )}
          </div>

          <div className="flex">
            <input
              className="flex-grow p-2 border border-gray-300 rounded-l"
              value={input}
              onChange={(e) => setInput(e.target.value)}
              onKeyDown={(e) => e.key === 'Enter' && handleSend()}
              disabled={loading}
              placeholder="H·ªèi tr·ª£ l√Ω v·ªÅ chuy·∫øn ƒëi c·ªßa b·∫°n..."
            />
            {/* <ChatBox /> */}
            <button
              onClick={handleSend}
              className="px-4 py-2 bg-blue-600 text-white rounded-r hover:bg-blue-700 transition"
              disabled={loading}
            >
              G·ª≠i
            </button>
          </div>
        </div>
      </div>

      <div className="scroll-indicator">
        <svg width="24" height="24" fill="#fff">
          <circle cx="12" cy="12" r="10" />
        </svg>
      </div>
    </div>
  );
};

export default Home;
